INSERT INTO `questions_in_languages` (`idquestion`, `idlanguage`, `desc`, `title`) VALUES
(1, 1, 'How much mental workload did the activities in the class impose on you?', 'Mental workload'),
(2, 1, 'How much mental and perceptual activity was required by the activities in the class? In other words, was the class easy or demanding (simple or complex)?', 'Mental demand'),
(3, 1, 'How irritated, stressed and annoyed versus content, relaxed, and complacent did you feel during the class? In other words, what was your state of mind while attending the class and its activities: were you generally feeling quite irritated, stressed and annoyed or were you quite content and relaxed during the actual peer review process?', 'Frustration'),
(4, 1, 'How much time pressure did you feel due to the pace at which the class and its activities occurred? In other words, was the pace slow or rapid?', 'Temporal demand'),
(5, 1, 'How hard did you have to work (mentally) to accomplish your level of performance during the class?', 'Effort'),
(6, 1, 'How successful were you in the class? In other words, how satisfied were you with your level of performance?', 'Performance'),
(7, 1, 'Did you attend just this class or were you engaged in other parallel tasks (mobile browsing/social networks, chatting, reading, conversations etc.) during the class?', 'Parallelism'),
(8, 1, 'How often were you interrupted during the class? In other words, were distractions (mobile, interruptions, noise, questions, other activities, etc.) not influential or did they negatively influence your attention towards the class?', 'Context bias'),
(9, 1, 'Are you motivated to attend this class?', 'Motivation'),
(10, 1, 'Did your skills, in the specific domain/topics of the class you have attended, have no influence or did they facilitate your understanding an participation?', 'Skill'),
(11, 1, 'How much experience/knowledge do you have with the topics and instructional material presented in the class?', 'Past knowledge and expertise'),
(12, 1, 'Are you alerted? In other words, are you sleepy/tired or fully activated/awake?', 'Alertness'),
(13, 1, 'How much attention was required in the class for activities like remembering, problem-solving, decision-making and perceiving (eg. consulting instructional material, recognising and identifying relevant information, mathematical calculations, etc.)?', 'Solving and deciding'),
(14, 1, 'How much attention was required for selecting the proper response channel and its execution?(eg. manual->keyboard/mouse, speech->voice)', 'Selection of response'),
(15, 1, 'How much attention was required for spatial processing (spatially pay attention around you)?', 'Task and space'),
(16, 1, 'How much attention was required for verbal material (eg. reading or processing linguistic material or listening to verbal conversations)?', 'Verbal material'),
(17, 1, 'How much attention was required for executing the activities in the class based on the information visually received (through eyes)?', 'Visual resources'),
(18, 1, 'How much attention was required for executing the activities in the class based on the information auditorily received (ears)?', 'Auditory resources'),
(19, 1, 'How much attention was required for manually respond to the activities in the class (eg. keyboard/mouse usage or writing or gestures)?', 'Manual response'),
(20, 1, 'How much attention was required for producing the speech response (eg. engaging in a conversation or talk or making/answering questions)?', 'Speech response'),
(21, 1, 'Are you motivated after this class?', 'Motivation'),
(22, 1, 'Were you alerted during the class? In other words, were you sleepy/tired or fully activated/awake?', 'Alertness'),
(23, 1, 'How irritated, stressed and annoyed versus content, relaxed, and complacent are you?', 'Frustration');
